var test = require("./testrunner");

function babyccino() {
  var assertionLibErrors = [].slice.call(arguments);
  var tests = {};
  var testResults = {};
  var failedTests = [];

	document.body.style.fontSize = "10em";
  document.body.style.fontFamily = "sans-serif";
  document.body.style.textAlign = "center";

  if (Notification.permission !== "granted") {
    Notification.requestPermission();
  }
  runChangedTests(require.context(babyccinoPath, true, babyccinoRegex), tests, testResults, failedTests);

  window.rerun = function (n) {
    console.log(failedTests);
    failedTests.slice(n)[0]();
  }

  test.assertionLocations = initAssertionLocations();

  if (module.hot) {
    module.hot.accept(require.context(babyccinoPath, true, babyccinoRegex).id, () => runChangedTests(require.context(babyccinoPath, true, babyccinoRegex), tests, testResults, failedTests));
  }
}

function initAssertionLocations() {
  return [
    //Feel free to add other assertion libraries here
    function () {
      try {
        var expect = require("unexpected");
      } catch (e) {
        return;
      }
      expect(true, "to be", false);
    },
    function () {
      try {
        var chai = require("chai");
      } catch (e) {
        return;
      }
      //chai has its own stack mangling routine, but I like mine better so I'm disabling it here
      chai.config.includeStack = true;
      chai.expect(true).to.eql(false);
    }
  ].map(function (errorMaker) {
    var assertionError;
    var thisError;
    try { errorMaker() } catch(e) { assertionError = e.stack; }
    try { throw new Error(); } catch(e) { thisError = e.stack; }
    if (assertionError) {
      return assertionError.split("\n").slice(0, -thisError.split("\n").length).slice(-1).join("");
    } else {
      return undefined;
    }
  }).filter(function (line) { return line !== undefined; });

}

function runChangedTests(newTests, loadedTests, testResults, failedTests) {
  failedTests.splice(0, failedTests.length);
  newTests.keys().map(function (key) {
    if (!(key in loadedTests) || loadedTests[key] !== newTests(key)) {
      loadedTests[key] = newTests(key);
      test(loadedTests[key], key)
        .then(function (testResult) {
          testResults[key] = testResult;
          testResult.filter(x=>x!==undefined).forEach(x=>failedTests.push(x));
        });
    }
  });
  test.chain.then(() => displayResults(testResults));
}

function displayResults(testResults) {
	var totalTests = 0;
	var failed = 0;
	Object.keys(testResults).forEach(function (key) {
		totalTests += testResults[key].length;
		failed += testResults[key].filter(x => x !== undefined).length;
	});
	if (failed > 0) {
		document.body.style.color = "#d90000";
		document.body.innerHTML = "&#x2717; " + failed + "/" + totalTests;
    var n = new Notification('Notification title', {
      icon: 'data:image/png;base64,',
      body: failed + " tests failed!",
    });
    setTimeout(n.close.bind(n), 500);
	} else {
		document.body.style.color = "green";
		document.body.innerHTML = "&#x2713; " + totalTests;
	}
}

babyccino();
